import { Link } from 'react-router-dom';
import styles from '../css/headerpedido.module.css';

const Headerpedido = () => {
  return (
    <header className={styles.header}>
      <Link to='/'>
       <button>REGRESAR</button>
      </Link>

      {/* <Link to='/terminado'>
            </Link> */}
    </header>
  );
};

export default Headerpedido;
